Helper.Remote = {
	// from 
	fromSubmit : function(form, params)
	{// form ID. params ajax
		var pp = {
			error : function(XMLHttpRequest, textStatus, errorThrown)
			{
				layer.open({
					type : 1,
					title : "",
					area : [ '95%', '95%' ],
					content : "<div id='layerError' style='color:red'>" + XMLHttpRequest.responseText + "</div>"
				});
			}
		};
		$.extend(pp, params);
		$(form).ajaxSubmit(pp);
	},
	// POST
	post : function(url)
	{
		var async = false;
		var params = null;
		var success = null;
		var error = null;
		var len = arguments.length;
		if (len == 5)
		{// url,params,success,error,async
			params = arguments[1];
			success = arguments[2];
			error = arguments[3];
			async = arguments[4];
		} else if (len == 4)
		{// url,params,success,error
			params = arguments[1];
			success = arguments[2];
			error = arguments[3];
		} else if (len == 3)
		{
			if (typeof (arguments[1]) === "function")
			{// url,success,error
				success = arguments[1];
				error = arguments[2];
			} else
			{// url,params,success
				params = arguments[1];
				success = arguments[2];
			}
		} else if (len == 2)
		{
			if (typeof (arguments[1]) === "function")
			{// url,success
				success = arguments[1];
			} else
			{// url,params
				params = arguments[1];
			}
		}
		$.ajax({
			type : "post",
			url : url,
			data : params,
			async : async,// 
			dataType : "json",
			beforeSend : function()
			{
				layer.load(1);
			},
			complete : function()
			{
				layer.closeAll('loading');
			},
			success : success,
			error : error
		});
	},
	getJson : function(url, params)
	{
		var result = null;
		$.ajax({
			type : "get",
			url : url,
			data : params,
			async : false,// 
			dataType : "json",
			success : function(data)
			{
				result = data;
			}
		});
		return result;
	},
	request : function(obj)
	{
		$.ajax({
			type : obj.method || "POST",
			url : obj.url,
			data : JSON.stringify(obj.data || {}),// formJSON
			dataType : obj.dataType || "json",
			contentType : obj.contentType || 'application/json;charset=utf-8', // 
			async : obj.async || true,// 
			success : obj.success,
			error : obj.error || (function(data)
			{
				Helper.message.warn("")
			}),
			beforeSend : function()
			{
				layer.load(1);
			},
			complete : function()
			{
				layer.closeAll('loading');
			}
		});
	}
};

